import Splash from "../layout/Splash";

let pageTitle = {
  title: "Byte Digital - Digital Creative Services",
};

const Home = () => (
  <Splash data={pageTitle}>
    <main>
      <div className="container text-center">
        <div className="hero-content style1">
          <h1 className=" text-blue">
            We are a digital <br /> creative agency
          </h1>
          <h4 className="text-lowercase text-blue font-weight-normal">
            creating web and mobile services and solutions for businesses and
            brands.
          </h4>
        </div>
      </div>
    </main>
  </Splash>
);

export default Home;
